import React from "react";
import {
  SafeAreaView,
  Text,
  TextInput,
  TouchableOpacity,
  View,
  StyleSheet,
} from "react-native";
import { Entypo } from '@expo/vector-icons';

export default function Information() {
  return (
    <SafeAreaView style={styles.container}>
      <Text style={styles.hey}>Hey,</Text>
      <Text style={styles.login}>Login Now.</Text>
      <View style={styles.section}>
        <Text style={styles.sectiontxt}>If you are new /  </Text>
        <TouchableOpacity>
        <Text style={{fontSize: 22, fontWeight:'500'}}>Create New</Text></TouchableOpacity>
      </View>
      <View style={styles.agencyinput}>
        <TextInput
          placeholder="Dstudio_agency"
          placeholderTextColor={"black"}
          style={{outline:'none'}}
        />
        <TouchableOpacity style={{bac}}>
        <Entypo name="pin" size={24} color="black" /></TouchableOpacity>
      </View>
      <View style={styles.passwordinput}>
        <TextInput placeholder="Password" placeholderTextColor={"dimgrey"} style={{outline:'none'}} />
      </View>
      <View style={styles.section}>
        <Text style={styles.sectiontxt}>Forgot Passcode?/  </Text>
        <TouchableOpacity>
        <Text style={{fontSize: 22, fontWeight:'500'}}>Reset</Text></TouchableOpacity>
      </View>
      <TouchableOpacity>
        <Text>Login</Text>
      </TouchableOpacity>
    </SafeAreaView>
  );
}

